var lightDarkStyleKey="editor-style";var styleDark="dark";var styleLight="light";function getLightDarkStyle(){var a=window.localStorage.getItem(lightDarkStyleKey);if(a===styleLight){return styleLight}else{return styleDark}}function deleteOldStyle(){var a=$("#style-link")[0];if(a!==null&&a!==undefined){a.remove()}}function setStyleDark(){window.localStorage.setItem(lightDarkStyleKey,styleDark);deleteOldStyle();$("head").append('<link id="style-link" rel="stylesheet" href="css/style-dark.css">')}function setStyleLight(){window.localStorage.setItem(lightDarkStyleKey,styleLight);deleteOldStyle();$("head").append('<link id="style-link" rel="stylesheet" href="css/style-light.css">')}if(getLightDarkStyle()===styleDark){setStyleDark()}else{setStyleLight()};